import React from "react";
import Table from "../utilities/table";
const Users = () => {
  return (
    <div className="row no-gutters">
      <div className="col p-2" style={{ height: "600px", width: "600px" }}>
        <Table></Table>
      </div>
    </div>
  );
};

export default Users;
